#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <stdio.h>
#include <climits>
#include <cstring>
#include <cassert>
#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <vector>
#include <string>
#include <stack>

using namespace std;

vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    string current_group;
    stack<char> paren_stack;

    // Remove spaces from the input string
    paren_string.erase(remove(paren_string.begin(), paren_string.end(), ' '), paren_string.end());

    for (char ch : paren_string) {
        current_group += ch;

        if (ch == '(') {
            paren_stack.push(ch);
        } else if (ch == ')') {
            paren_stack.pop();
        }

        // If the stack is empty, we have a balanced group
        if (paren_stack.empty()) {
            result.push_back(current_group);
            current_group.clear();
        }
    }

    return result;
}


