#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <vector>
#include <string>
#include <sstream>

using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> results;
    stringstream ss(paren_string);
    string group;

    while (getline(ss, group, ' ')) {
        int max_depth = 0;
        int current_depth = 0;

        for (char c : group) {
            if (c == '(') {
                current_depth++;
                if (current_depth > max_depth) {
                    max_depth = current_depth;
                }
            } else if (c == ')') {
                current_depth--;
            }
        }

        results.push_back(max_depth);
    }

    return results;
}


