#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <vector>
#include <string>
using namespace std;

string longest(vector<string> strings) {
    // Check if the vector is empty
    if (strings.empty()) {
        return ""; // Return an empty string to represent None
    }

    // Initialize variables to keep track of the longest string
    string longest_string = strings[0];

    // Iterate through the vector to find the longest string
    for (const string& str : strings) {
        if (str.length() > longest_string.length()) {
            longest_string = str;
        }
    }

    return longest_string;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (longest({}) == "");
    assert (longest({"x", "y", "z"}) == "x");
    assert (longest({"x", "yyy", "zzzz", "www", "kkkk", "abc"}) == "zzzz");
}

