#include <stdio.h>
#include <math.h>
#include <vector>
using namespace std;

double poly(vector<double> xs, double x) {
    double sum = 0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double poly_derivative(vector<double> xs, double x) {
    double sum = 0;
    for (int i = 1; i < xs.size(); i++) {
        sum += i * xs[i] * pow(x, i - 1);
    }
    return sum;
}

double find_zero(vector<double> xs) {
    // Initial guess can be the midpoint of the interval
    double x0 = 0.0;
    double tolerance = 1e-7;
    int max_iterations = 1000;

    for (int i = 0; i < max_iterations; i++) {
        double fx = poly(xs, x0);
        double dfx = poly_derivative(xs, x0);

        if (fabs(fx) < tolerance) {
            return x0;
        }

        x0 = x0 - fx / dfx;
    }

    // If we exceed the maximum number of iterations, return the last estimate
    return x0;
}


#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

