using namespace std;

string change_base(int x, int base) {
    if (x == 0) return "0"; // Special case for zero

    string result = "";
    while (x > 0) {
        int remainder = x % base;
        result += to_string(remainder); // Append the remainder to the result string
        x /= base;
    }

    // Since we appended the remainders in reverse order, we need to reverse the string
    reverse(result.begin(), result.end());

    return result;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (change_base(8, 3) == "22");
    assert (change_base(9, 3) == "100");
    assert (change_base(234, 2) == "11101010");
    assert (change_base(16, 2) == "10000");
    assert (change_base(8, 2) == "1000");
    assert (change_base(7, 2) == "111");
    for (int x=2;x<8;x++)
        assert (change_base(x, x + 1) == to_string(x));
}

