// Function to check if a given string is a palindrome
bool is_palindrome(const std::string& text) {
    int n = text.length();
    for (int i = 0; i < n / 2; ++i) {
        if (text[i] != text[n - i - 1]) {
            return false;
        }
    }
    return true;
}

