int fib(int n) {
    if (n <= 0) {
        return 0; // Handle the case where n is less than or equal to 0
    } else if (n == 1) {
        return 1; // Base case for the first Fibonacci number
    } else {
        int a = 0, b = 1, c;
        for (int i = 2; i <= n; i++) {
            c = a + b;
            a = b;
            b = c;
        }
        return b;
    }
}


