bool correct_bracketing(string brackets) {
    int count = 0;
    for (char bracket : brackets) {
        if (bracket == '<') {
            count++;
        } else if (bracket == '>') {
            count--;
        }
        // If count goes negative, it means there are unmatched closing brackets
        if (count < 0) {
            return false;
        }
    }
    // If count is zero, all brackets are matched
    return count == 0;
}


