vector<int> common(vector<int> l1, vector<int> l2) {
    // Sort both vectors
    sort(l1.begin(), l1.end());
    sort(l2.begin(), l2.end());

    // Use a set to store unique common elements
    set<int> commonSet;

    // Use two pointers to traverse both vectors
    int i = 0, j = 0;
    while (i < l1.size() && j < l2.size()) {
        if (l1[i] == l2[j]) {
            commonSet.insert(l1[i]);
            i++;
            j++;
        } else if (l1[i] < l2[j]) {
            i++;
        } else {
            j++;
        }
    }

    // Convert the set to a sorted vector
    vector<int> result(commonSet.begin(), commonSet.end());
    return result;
}


