#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <stdio.h>
#include <vector>
#include <climits>
#include <cstring>
#include <cassert>
#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <string>
#include <stack>
using namespace std;

bool correct_bracketing(string brackets) {
    stack<char> s;

    for (char bracket : brackets) {
        if (bracket == '(') {
            s.push(bracket);
        } else if (bracket == ')') {
            if (s.empty() || s.top() != '(') {
                return false;
            }
            s.pop();
        }
    }

    return s.empty();
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (correct_bracketing("()"));
    assert (correct_bracketing("(()())"));
    assert (correct_bracketing("()()(()())()"));
    assert (correct_bracketing("()()((()()())())(()()(()))"));
    assert (not (correct_bracketing("((()())))")));
    assert (not (correct_bracketing(")(()")));
    assert (not (correct_bracketing("(")));
    assert (not (correct_bracketing("((((")));
    assert (not (correct_bracketing(")")));
    assert (not (correct_bracketing("(()")));
    assert (not (correct_bracketing("()()(()())())(()")));
    assert (not (correct_bracketing("()()(()())()))()")));
}

