int vowels_count(string s) {
    int count = 0;
    transform(s.begin(), s.end(), s.begin(), ::tolower); // Convert the string to lowercase

    for (char c : s) {
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            count++;
        }
    }

    // Check if 'y' is at the end of the word
    if (!s.empty() && s.back() == 'y') {
        count++;
    }

    return count;
}

