int starts_one_ends(int n) {
    if (n == 1) {
        // Special case: For a single digit number, the only number that starts or ends with 1 is 1 itself.
        return 1;
    }
    // Calculate the total count using the formula derived above
    int total = 2 * pow(10, n-1) - pow(10, n-2);
    return total;
}


