int add(vector<int> lst) {
    int sum = 0;
    for (size_t i = 0; i < lst.size(); ++i) {
        if (i % 2 != 0 && lst[i] % 2 == 0) {
            sum += lst[i];
        }
    }
    return sum;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (add({4, 88}) == 88);
    assert (add({4, 5, 6, 7, 2, 122}) == 122);
    assert (add({4, 0, 6, 7}) == 0);
    assert (add({4, 4, 6, 8}) == 12);
}

