#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <stdio.h>
#include <vector>
#include <climits>
#include <cstring>
#include <cassert>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <string>
#include <bitset>

using namespace std;

string solve(int N) {
    // Step 1: Calculate the sum of the digits of N
    int sum = 0;
    int temp = N;
    while (temp > 0) {
        sum += temp % 10;  // Add the last digit to the sum
        temp /= 10;        // Remove the last digit
    }

    // Step 2: Convert the sum to its binary representation
    string binarySum = bitset<32>(sum).to_string();  // Convert to binary string

    // Step 3: Remove leading zeros from the binary string
    size_t pos = binarySum.find('1');  // Find the first '1'
    if (pos != string::npos) {
        binarySum = binarySum.substr(pos);  // Extract the substring from the first '1'
    } else {
        binarySum = "0";  // If no '1' is found, the sum was 0
    }

    return binarySum;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (solve(1000) == "1");
    assert (solve(150) == "110");
    assert (solve(147) == "1100");
    assert (solve(333) == "1001");
    assert (solve(963) == "10010");
}

