#include <queue>
#include <bits/stdc++.h>

#include <iostream>
#include <string>
#include <algorithm>
#include <sstream>

using namespace std;

string anti_shuffle(string s) {
    // Create a stringstream to split the input string by spaces
    stringstream ss(s);
    string word;
    string result;

    // Process each word in the string
    while (ss >> word) {
        // Sort the characters of the word in ascending order
        sort(word.begin(), word.end());
        // Append the sorted word to the result string
        result += word + " ";
    }

    // Remove the trailing space if there is any
    if (!result.empty()) {
        result.pop_back();
    }

    return result;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (anti_shuffle("Hi") == "Hi");
    assert (anti_shuffle("hello") == "ehllo");
    assert (anti_shuffle("number") == "bemnru");
    assert (anti_shuffle("abcd") == "abcd");
    assert (anti_shuffle("Hello World!!!") == "Hello !!!Wdlor");
    assert (anti_shuffle("") == "");
    assert (anti_shuffle("Hi. My name is Mister Robot. How are you?") == ".Hi My aemn is Meirst .Rboot How aer ?ouy");
}

