    for (int num : lst) {
        if (isPrime(num) && num > largestPrime) {
            largestPrime = num;
        }
    }

    // If no prime is found, return 0 (though the problem guarantees there is at least one prime)
    if (largestPrime == -1) return 0;

    // Sum the digits of the largest prime
    return sumOfDigits(largestPrime);
}


