#include<stdio.h>

int multiply(int a, int b) {
    // Extract the unit digits
    int unit_digit_a = abs(a) % 10;
    int unit_digit_b = abs(b) % 10;

    // Calculate the product of the unit digits
    int product = unit_digit_a * unit_digit_b;

    return product;
}


