    string result;
    for (char ch : s) {
        if (c.find(ch) == string::npos) {
            result += ch;
        }
    }

    // Step 2: Check if the result string is a palindrome
    bool isPalindrome = true;
    int n = result.length();
    for (int i = 0; i < n / 2; ++i) {
        if (result[i] != result[n - i - 1]) {
            isPalindrome = false;
            break;
        }
    }

    // Step 3: Prepare the result vector
    vector<string> resultVector;
    resultVector.push_back(result);
    resultVector.push_back(isPalindrome ? "True" : "False");

