using namespace std;

map<char, int> histogram(string test) {
    map<char, int> frequencyMap;
    map<char, int> resultMap;

    // Step 1: Populate the frequency map
    istringstream iss(test);
    string word;
    while (iss >> word) {
        for (char c : word) {
            frequencyMap[c]++;
        }
    }

    // Step 2: Find the maximum frequency
    int maxFrequency = 0;
    for (const auto& pair : frequencyMap) {
        if (pair.second > maxFrequency) {
            maxFrequency = pair.second;
        }
    }

    // Step 3: Populate the result map with letters having the maximum frequency
    for (const auto& pair : frequencyMap) {
        if (pair.second == maxFrequency) {
            resultMap[pair.first] = pair.second;
        }
    }

    return resultMap;
}


