// Function to count the number of ones in the binary representation of an integer
int count_ones(int num) {
    return bitset<32>(num).count();
}

// Custom comparator function for sorting
bool custom_compare(int a, int b) {
    int count_a = count_ones(a);
    int count_b = count_ones(b);

    if (count_a == count_b) {
        return a < b; // If number of ones is the same, sort by decimal value
    }
    return count_a < count_b; // Otherwise, sort by number of ones
}

