bool is_nested(string str) {
    int open_brackets = 0;
    int close_brackets = 0;

    for (char ch : str) {
        if (ch == '[') {
            open_brackets++;
        } else if (ch == ']') {
            close_brackets++;
        }

        // Check if there is a nested pair
        if (close_brackets > open_brackets) {
            return true;
        }
    }

    // If no nesting is found
    return false;
}

