    long long result = 1;
    for (int i = 1; i <= num; i++) {
        result *= i;
    }
    return result;
}

// Function to calculate the Brazilian factorial
long long special_factorial(int n) {
    long long result = 1;
    for (int i = n; i >= 1; i--) {
        result *= factorial(i);
    }
    return result;
}


