#include <algorithm>
using namespace std;

vector<string> sorted_list_sum(vector<string> lst) {
    // Step 1: Filter out strings with odd lengths
    vector<string> filtered_lst;
    for (const string& s : lst) {
        if (s.length() % 2 == 0) {
            filtered_lst.push_back(s);
        }
    }

    // Step 2: Sort the filtered strings
    sort(filtered_lst.begin(), filtered_lst.end(), [](const string& a, const string& b) {
        if (a.length() == b.length()) {
            return a < b; // Sort alphabetically if lengths are the same
        }
        return a.length() < b.length(); // Sort by length
    });

    return filtered_lst;
}

