using namespace std;

bool cycpattern_check(string a, string b) {
    int n = b.length();
    if (n == 0) return true; // An empty string is always a substring

    // Concatenate b with itself to handle all rotations
    string rotatedB = b + b;

    // Check if any rotation of b is a substring of a
    for (int i = 0; i < n; ++i) {
        string rotation = rotatedB.substr(i, n);
        if (a.find(rotation) != string::npos) {
            return true;
        }
    }

    return false;
}


